import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="box-container">
        <nav className="box">
          <h3>quick links</h3>
          <a href="#">
            <i className="fas fa-chevron-right" aria-hidden="true"></i> home
          </a>
          {/* Add similar links for other sections */}
        </nav>

        <div className="box">
          <h3>contact info</h3>
          <a href="#">
            <i className="fas fa-phone" aria-hidden="true"></i> +917788660212
          </a>
          {/* Add similar links for other contact information */}
        </div>

        <div className="box">
          <h3>follow us</h3>
          <a href="#">
            <i className="fab fa-facebook-f" aria-hidden="true"></i> facebook
          </a>
          {/* Add similar links for other social media */}
        </div>
      </div>

      <div className="credit">
        created by <span>XYZ</span> | all rights reserved 2023
      </div>
    </footer>
  );
};

export default Footer;
